vid colors. Bring amazing view sight. The camera with a ???°FOV lens and ??°adjustable camera gives a broad view of your memorable moment.\n??? ???? ?????? ???? ??????? ??? ??? ??????: The drone will auto-returning to the takeoff location when it\'s lost signal, or low power, don\'t have to worry about losing your drone, just enjoy the fun of flying.','Ruko',NULL,499.25,419.99,1,'Drones',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'default_listing.png','2023-08-01 02:54:34','2023-07-31 22:52:36'),(162,36,2819,'TRI-1120-XGO','Tribit XSound Go Bluetooth Speaker - 12W Portable Loud Stereo - Open Box','Smaller Size, Bigger Sound\r\nDon’t let its compact size fool you— the Tribit XSound Go provides sound that’s larger than life. Dual 6W high-performance drivers and a premium passive bass radiator create soaring highs, electrifying mids, and rich bass. Your music will be smooth and clear, even when cranked to maximum volume!\r\n\r\nIncredible 24 Hour Playtime\r\nNo outlet? No problem. A powerful, rechargeable lithium ion battery offers up to 24 hours of non-stop use. It’s the perfect speaker for traveling, camping trips, barbecues, or anywhere else you might need a little ambience.\r\n\r\nTake Your Tunes on the Road\r\nAt only 13oz, this featherlight portable speaker is easy to carry from place to place. Throw it in your backpack, purse, or beach bag for music on the go. We’ve also attached a convenient carrying strap for maximum portability.\r\n\r\nPool Party Waterproof\r\nWith top of the line IPX7 waterproofing, water won’t slow you down. It’s perfect for the pool, the shower, the backyard, and everywhere in between.\r\n\r\nWireless Bluetooth Connection\r\nAdvanced bluetooth 4.2 technology provides a completely wireless connection with an amazing 66ft range! Pairing is simple— Just enter your device’s bluetooth settings, click on “Tribit XSound Go”, and enjoy.\r\n\r\nUniversal Compatibility\r\nThe Tribit XSound Go is compatible with all bluetooth enabled devices. Pair it with your iPhone, Samsung, Amazon Echo/ Echo Dot, laptop and so much more. A 3.5 mm audio cable (not included) can be used to play audio from desktop computers, TVs, MP3 players.','Tribit',NULL,39.99,39.99,10,'Portable, Wireless & Compact Speaker Systems',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'default_listing.png','2023-08-03 18:39:36','2023-08-01 00:26:51'),(794,38,3801,'RUK-F11PRO','Ruko F11PRO GPS Drone with 4K Camera','6? ???? ?????? ????: F11PRO camera drone equipped with 2 powerful 11.1V 2500mAh intelligent batteries provides up to 60 minutes flight time in total, giving you more fun!\r\n???? ?? ????? ??? ??? ?? ???: It comes with beginner settings to let you get used to then you can use other functions further, easy to fly for all levels. Intelligent flight features like Follow Me Mode, Tap Fly, Point of Interest, Hand Gesture Shots make you fly like an expert to explore the fun of the aerial film, just One-click, It will fly itself and film your creative video.\r\n????? ? ???? ??????????: The brushless motor has stronger power, which can make the drone fly more stably and can resist the wind of level 6. The aluminum alloy casing is more durable than others of iron motors, it is durable for a long time used.\r\n?? ??? ??????: Experience splendid 4k Ultra HD picture quality and 2.9k video for stunning clarity, high contrast, and vivid colors. Bring amazing view sight. The camera with a ???°FOV lens and ??°adjustable camera gives a broad view of your memorable moment.\r\n??? ???? ?????? ???? ??????? ??? ??? ??????: The drone will auto-returning to the takeoff location when it\'s lost signal, or low power, don\'t have to worry about losing your drone, just enjoy the fun of flying.','Ruko','Drones',499.25,419.99,1,'CAT_616514',0,'2023-09-22 12:09:00','2023-09-13 12:09:00',9.00,10.00,1,'123','hello',1,'yes','typex','default_listing.png',NULL,'2023-09-14 09:09:41');
